    false,nt"url": null,nt"notes": "The goal of this study is to assess the
    water quality impacts associated with refuge water and habitat management (irrigation
    of hay and rake-bunch meadows, grazing, surface and subsurface return flows from
    both wetlands and agricultural fields, dam operations) and to assess BMPs that may
    be used to address water quality concerns.  This study quantifies the extent of
    water degradation associated with current management practices on the refuge. This
    information will allow the refuge to prepare a water quality monitoring plan for
    future monitoring and to evaluate and implement BMPs that provide habitat for wildlife
    (migratory birds and redband trout), improve water quality and aquatic habitat on
    the refuge, and comply with Oregon law.",nt"license_title": "License Not Specified",nt"extras":
